// import React from 'react';

var grid = document.getElementById('mainGrid');

for (let i = 0; i < 20; i++) {
    let node = document.createElement("tr");
    grid.appendChild(node);

    let row = grid.lastChild;

    for (let j = 0; j < 51; j++) {
        node = document.createElement("td");
        let x = i+10;
        let y = j+10;
        let a = x + "" + y;

        row.appendChild(node);
        row.lastChild.id = a;
    }
}

// document.getElementById("1010").innerHTML ='<i class="fa fa-dot-circle-o" aria-hidden="true"></i>'; // target

var j = 0,i=0;

function fill(i,j){
    setTimeout(function(){
        let x = i + 10;
        let y = j + 10;
        document.getElementById(x+""+y).classList.add("abc");
    },50*(i+j))
}
function fill1(i, j) {
    setTimeout(function () {
        let x = i + 10;
        let y = j + 10;
        document.getElementById(x + "" + y).classList.add("def");
    }, 50 * (i + j))
}
for(let i=0;i<10;i++){
    for(let j=0;j<10;j++){
        fill(i,j);
        fill1(i,j+10);
    }
}

